const Items = [
    {
        id: 1,
        title: 'One',
        amount: '$289',
        date: new Date(2023, 2, 1)
    },
    {
        id: 2,
        title: 'One',
        amount: '$289',
        date: new Date(2023, 2, 2)
    },
    {
        id: 3,
        title: 'One',
        amount: '$289',
        date: new Date(2023, 1, 2)
    },
]

export default Items;
